import React from "react";
import { Page, Text, View, Document, StyleSheet } from "@react-pdf/renderer";
import { PDFViewer } from '@react-pdf/renderer';
import "../Forms.css";


const styles = StyleSheet.create({
  page: {
    flexDirection: "column",


  },
  section: {
    margin: 10,
    padding: 10,
    flexGrow: 1,
    borderWidth: "0.1cm",
    borderStyle: "solid",
    borderColor: "#000000",
    borderRadius: "2cm",
  },
});

const Form1 = () => {
  return (
    <div className="pdf-fram">
        <div className="back">
        <button className="back-button">
            الرجوع
        </button>
        </div>
    <PDFViewer className="pdf-fram">
      <Document>
        
        <Page size="A4" style={styles.page}>
          <View style={styles.section}>
            <Text>Section #1</Text>
          </View>
        </Page>
        <Page size="A4" style={styles.page}>

        </Page>
      </Document>
    </PDFViewer>
    </div>
  );
};

export default Form1;
